import styled from "styled-components";
import React from 'react'
import "../../App.css";
import {BrowserRouter as Router, Link} from "react-router-dom";


function  OutNavbar(){
  return (
   <Router>   
    <Container>
        <a>
            <h1>A. Workspace</h1>
        </a>
        <Menu>
            <Link to="/">Home</Link>
            <Link to="../BeforeLoginPages/Solutions.js">Solutions</Link>
            <Link to="../BeforeLoginPages/Pricing.js">pricing</Link>
        </Menu>
        <RightMenu>
            <Link to='../BeforeLoginPages/ContactUs.js'>ContactUs</Link>
            <Link to='../BeforeLoginPages/Login.js'>Login</Link>
        </RightMenu>
    </Container>
    <Switch>
        <Route path="/" exact>
            <Home />
        </Route>
    </Switch>
   </Router>
  )
}

export default OutNavbar

const Container = styled.div`
    background: white;
    min-height: 50px;
    position: fixed;
    display: flex;
    align-items: center;
    top: 0;
    left: 0;
    right: 0;

    a {
        color: blue;
        font-family: poppins;
        text-decoration: none;
        font-size: 14px;
        font-weight: 600;
        padding: 0 10px;
    }
`

const Menu = styled.div`
    display: flex;
    justify-content: center;
    flex: 1;

    a {
        color: #000000;
        font-family: poppins;
        text-decoration: none;
        font-size: 14px;
        padding: 0 10px;
    }
`

const RightMenu = styled.div`
   display: flex;

       a {
        color: #000000;
        font-family: poppins;
        text-decoration: none;
        font-size: 14px;
        padding-right:30px ;
    }
`
